	remove: function(el, url) {
		if ($(window.parent.document).length == 1) {
			$.ajax({
				url: url,
				type: 'GET',
				dataType: 'json',
				beforeSend: function() {
					$(el).button('loading');
				}
			}).always(function(){
				$(el).button('reset');
			}).done(function(res){
				if (res.success !== undefined) {
					window.parent.$.notify({
						message: '<i class="fa fa-check-circle"></i> ' + res.success + '<button type="button" class="close" data-dismiss="alert">&times;</button></div>'
					},{
						type: 'minimalist',
						delay: 5000,
						icon_type: 'image',
						template: '<div data-notify="container" class="col-xs-11 col-sm-3 alert alert-{0}" role="alert">' +
							'<i class="fa fa-shopping-bag fa-3 pull-left"></i>' +
							'<span data-notify="message">{2}</span>' +
						'</div>'
					});
					window.location.reload();

					if ( res.total == 0 && window.parent.popupCompare !== undefined ) {
						window.parent.$.magnificPopup.close();
					}

					if ( res.text_compare !== undefined ) {
						$(window.parent.document).find('#compare-total').text(res.text_compare);
					}
				}
			});
			return false;
		}
		return true;
	}
